import React, { useEffect } from "react";
import Home from "./componants/Home";
import { Routes, Route } from "react-router-dom";
import { useGlobalContext } from "./context/global"

function App() {
  const { getPopularAnime, 
    getUpcomingAnime, 
    getAiringAnime, 
    getWinterAnime, 
    getSummerAnime, 
    getSpringAnime, 
    getFallAnime,
    popularAnime,
    upcomingAnime, 
    airingAnime, 
    winterAnime, 
    summerAnime, 
    springAnime, 
    fallAnime,
    loading
    } = useGlobalContext();

    /* popularAnime,
    upcomingAnime, 
    airingAnime, 
    winterAnime, 
    summerAnime, 
    springAnime, 
    fallAnime,
    loading */

  useEffect(() => {
    console.log("Fetching anime data...");
    getPopularAnime();
    getUpcomingAnime();
    getAiringAnime();
    getWinterAnime();
    // getSummerAnime();
    // getSpringAnime();
    // getFallAnime();
  }, []);

  return (
      <Routes>
        <Route path="/" element={<Home key="home" popularAnime={popularAnime} upcomingAnime={ upcomingAnime} airingAnime={ airingAnime} winterAnime={winterAnime} loading={loading}/>} />
      </Routes>
  );
}

export default App;
